import React from 'react';
import { NavLink } from 'react-router-dom';
import SearchBar from '../components/searchbar/searchbar'
// 
const Nav = (props) => {
    return (
      <nav>
  
        <div >
        <NavLink to="/home" >
            Home
          </NavLink> 
          <NavLink to="/favorites" >
            Favorites
          </NavLink>  
          <NavLink to="/about" >
            About
          </NavLink>
  
         
  
  
  
  
  
        </div>
  
        <NavLink to="/detail/:id" />
  
        <SearchBar fnct={props.fnct} />
      </nav>
    );
  };
  export default Nav;
